using namespace std;

class Solution {
private:
	unordered_map<int, int> m;
	unordered_map<int, vector<int> > indexs;
	vector<int> result;
	queue<pair<int, int> > q;
	
public:
	int minJumps(vector<int>& arr) {
		if (arr.size() <= 1) return 0;
		if (arr.size() == 2) return 1;
		
		(this->result).resize(arr.size(), std::numeric_limits<int>::max());
		
		for (int i = 0, end = arr.size(); i < end; ++i) {
			indexs[ arr[i] ].push_back(i);
		}
		
		q.push({0,0});
		while (!q.empty()) {
			auto [currPos,currStep] = q.front(); q.pop();
			if (currPos == arr.size() - 1) return currStep;
			if (currPos + 1 == arr.size() - 1) return currStep + 1;
			if (result[currPos] < currStep) continue;
			// cout << currPos << " ";
			
			result[currPos] = currStep;
			
			for (int i = indexs[ arr[currPos] ].size() - 1; i >= 0; i--) {
				int nextPos = indexs[ arr[currPos] ][i];
				if (m.count(nextPos) != 0) continue;
				
				q.push( {nextPos, currStep + 1} );
				m[  nextPos ]++;
				
				indexs[ arr[currPos] ].clear();
			}
			
			if (currPos < arr.size() - 1 && m.count(currPos + 1) == 0) {
				if (currPos + 1 == arr.size() - 1) return currStep + 1;
				
				q.push( {currPos + 1, currStep + 1} );
				m[currPos + 1]++;
			}
			
			
			if (currPos > 1 && m.count(currPos - 1) == 0) { 
				q.push( {currPos - 1, currStep + 1}  );
				m[currPos - 1]++;
			}
		}
		
		return result.back();
	}
};

